import * as React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { useFonts } from "expo-font";
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createNativeStackNavigator } from "@react-navigation/native-stack";

import GetStarted from "./screens/GetStarted";
import FrameComponent from "./components/FrameComponent";
import PlayerContent from "./screens/PlayerContent";
import PlayerContent1 from "./screens/PlayerContent1";
import SplashScreen from "./screens/SplashScreen";
import Logout from "./screens/Logout";
import CalendarPlayer from "./screens/CalendarPlayer";
import ChatScreen from "./screens/ChatScreen";
import AccountSetting from "./screens/AccountSetting";
import PhotoIDNotAdded from "./screens/PhotoIDNotAdded";
import PhotoIDNotAdded1 from "./screens/PhotoIDNotAdded1";
import PhotoIDNotAdded2 from "./screens/PhotoIDNotAdded2";
import PhotoIDNotAdded3 from "./screens/PhotoIDNotAdded3";
import UploadPhotoAdded from "./screens/UploadPhotoAdded";
import UploadPhotoAdded1 from "./screens/UploadPhotoAdded1";
import UploadPhotoNotAdded from "./screens/UploadPhotoNotAdded";
import UploadPhotoNotAdded1 from "./screens/UploadPhotoNotAdded1";
import TellUsMoreFilled from "./screens/TellUsMoreFilled";
import SelectPlayStyle from "./screens/SelectPlayStyle";
import TellUsMoreFilledGirl from "./screens/TellUsMoreFilledGirl";
import TellUsMoreFilledBoy from "./screens/TellUsMoreFilledBoy";
import TellUsMoreFilledGirl1 from "./screens/TellUsMoreFilledGirl1";
import TellUsMoreFilledBoy1 from "./screens/TellUsMoreFilledBoy1";
import TellUsMoreFilledGirl2 from "./screens/TellUsMoreFilledGirl2";
import TellUsMoreFilledBoy2 from "./screens/TellUsMoreFilledBoy2";
import Frame1 from "./screens/Frame1";
import Frame2 from "./screens/Frame";
import Frame11 from "./screens/Frame1";
import MyTeam from "./screens/MyTeam";
import MyTeam1 from "./screens/MyTeam1";
import NonTeamPlayerProfileCoach from "./screens/NonTeamPlayerProfileCoach";
import PlayerRoadToPro from "./screens/PlayerRoadToPro";
import PlayerStat from "./screens/PlayerStat";
import PlayerDashboardSomeoneElse from "./screens/PlayerDashboardSomeoneElse";
import PlayerProfileOnCoachsTeam from "./screens/PlayerProfileOnCoachsTeam";
import PlayerProfileSomeoneElse from "./screens/PlayerProfileSomeoneElse";
import PlayerDashboard from "./screens/PlayerDashboard";
import PlayerDashboard1 from "./screens/PlayerDashboard1";
import Search from "./screens/Search";
import Search1 from "./screens/Search1";

// Add other necessary imports here

const App = () => {
  const Tab = createBottomTabNavigator();

  const MyTabs = () => (
    <Tab.Navigator>
      <Tab.Screen name="Home" component={PlayerContent} />
      <Tab.Screen name="Profile" component={PlayerContent1} />
    </Tab.Navigator>
  );

  const [hideSplashScreen, setHideSplashScreen] = React.useState(true);

  const [fontsLoaded] = useFonts({
    // Add your font loading here
  });

  if (!fontsLoaded) {
    return null;
  }

  return (
    <NavigationContainer>
      {hideSplashScreen ? (
        <Stack.Navigator screenOptions={{ headerShown: false }}>
          <Stack.Screen name="GetStarted" component={GetStarted} />
          <Stack.Screen name="MyTeam" component={MyTeam} />
          <Stack.Screen name="MyTeam1" component={MyTeam1} />
          <Stack.Screen name="Frame" component={Frame} />
          <Stack.Screen name="Logout" component={Logout} />
          <Stack.Screen name="CalendarPlayer" component={CalendarPlayer} />
          <Stack.Screen name="ChatScreen" component={ChatScreen} />
          <Stack.Screen name="AccountSetting" component={AccountSetting} />
          <Stack.Screen name="PhotoIDNotAdded" component={PhotoIDNotAdded} />
          <Stack.Screen name="PhotoIDNotAdded1" component={PhotoIDNotAdded1} />
          <Stack.Screen name="PhotoIDNotAdded2" component={PhotoIDNotAdded2} />
          <Stack.Screen name="PhotoIDNotAdded3" component={PhotoIDNotAdded3} />
          <Stack.Screen name="UploadPhotoAdded" component={UploadPhotoAdded} />
          <Stack.Screen name="UploadPhotoAdded1" component={UploadPhotoAdded1} />
          <Stack.Screen name="UploadPhotoNotAdded" component={UploadPhotoNotAdded} />
          <Stack.Screen name="UploadPhotoNotAdded1" component={UploadPhotoNotAdded1} />
          <Stack.Screen name="TellUsMoreFilled" component={TellUsMoreFilled} />
          <Stack.Screen name="SelectPlayStyle" component={SelectPlayStyle} />
          <Stack.Screen name="TellUsMoreFilledGirl" component={TellUsMoreFilledGirl} />
          <Stack.Screen name="TellUsMoreFilledBoy" component={TellUsMoreFilledBoy} />
          <Stack.Screen name="TellUsMoreFilledGirl1" component={TellUsMoreFilledGirl1} />
          <Stack.Screen name="TellUsMoreFilledBoy1" component={TellUsMoreFilledBoy1} />
          <Stack.Screen name="TellUsMoreFilledGirl2" component={TellUsMoreFilledGirl2} />
          <Stack.Screen name="TellUsMoreFilledBoy2" component={TellUsMoreFilledBoy2} />
          <Stack.Screen name="Frame1" component={Frame1} />
          <Stack.Screen name="Frame2" component={Frame2} />
          <Stack.Screen name="Frame11" component={Frame11} />
          <Stack.Screen name="NonTeamPlayerProfileCoach" component={NonTeamPlayerProfileCoach} />
          <Stack.Screen name="PlayerRoadToPro" component={PlayerRoadToPro} />
          <Stack.Screen name="PlayerStat" component={PlayerStat} />
          <Stack.Screen name="PlayerDashboardSomeoneElse" component={PlayerDashboardSomeoneElse} />
          <Stack.Screen name="PlayerProfileOnCoachsTeam" component={PlayerProfileOnCoachsTeam} />
          <Stack.Screen name="PlayerProfileSomeoneElse" component={PlayerProfileSomeoneElse} />
          <Stack.Screen name="PlayerDashboard" component={PlayerDashboard} />
          <Stack.Screen name="PlayerDashboard1" component={PlayerDashboard1} />
          <Stack.Screen name="Search" component={Search} />
          <Stack.Screen name="Search1" component={Search1} />
          {/* Add other Stack.Screen components here */}
        </Stack.Navigator>
      ) : (
        <SplashScreen />
      )}
    </NavigationContainer>
  );
};

export default App;
